function toggleNav(){document.getElementById("sidebar")&&("sidebar"==document.getElementById("sidebar").className?document.getElementById("sidebar").className="navbar":"navbar"==document.getElementById("sidebar").className&&(document.getElementById("sidebar").className="sidebar"))}function forceHideNav(){document.getElementById("sidebar")&&"navbar"==document.getElementById("sidebar").className&&(document.getElementById("sidebar").className="sidebar")}function resizeNavigationHandler(){window.addEventListener("resize",resizeNavigationHandler);var e=document.getElementById("sidebar");null!=e&&"navbar"===e.className&&(e.className="sidebar")}
